export const ADD_TODO = 'ADD_TODO'
export const EDIT_TODO = 'EDIT_TODO'

export function AddTodo(item) {
    return { type: ADD_TODO, data: item }
}
export function EditTodo(item) {
    return { type: EDIT_TODO, data: item}
}
